-- El orden de borrado es importante
DROP TABLE REPARTO;
DROP TABLE ACTOR;
DROP TABLE PELICULA;

CREATE TABLE PELICULA(
	ID INTEGER,          -- Identificador unico
	TITULO CHAR(70),     -- Titulo de la pelicula
	AGNO DECIMAL(4),     -- A�o de extreno
	PUNTUACION FLOAT,    -- Puntuaci�n media
	VOTOS INTEGER,       -- Numero de votos
	PRIMARY KEY (ID));
--
CREATE TABLE ACTOR (
	ID INTEGER,          -- Identificador Unico
	NOMBRE CHAR(35),     -- Nombre del actor/actriz
	PRIMARY KEY (ID));
--
CREATE TABLE REPARTO(
	PELICULA_ID INTEGER, -- referencia a la tabla PELICULA
	ACTOR_ID INTEGER,    -- referencia a la tabla ACTOR_ID
	ORD INTEGER,         -- Orden en el reparto
                             -- La estrella es 1, ...
--
	FOREIGN KEY (PELICULA_ID ) REFERENCES PELICULA(ID),
	FOREIGN KEY (ACTOR_ID) REFERENCES ACTOR(ID),
	PRIMARY KEY (PELICULA_ID, ACTOR_ID));
